import "../PanelPage.css";
import "./MoviePage.css";
import moviesSvg from '../../../assets/panel-movies.svg'


function MoviePage(props) {
    return (
        <img src={moviesSvg} className="panel-head-image"/>
    );
}

export default MoviePage;
